        return props.list?.map((eachname) => {
            return (
                <div>
                    <Link to={`/list/${eachname._id}`} style={{ textDecoration: "none" }}>
                        <h1 className="storename" style={{ textDecoration: "none" }}>{eachname.store}</h1>
                    </Link>
                    <button>x</button>
                </div>
            )
        }
        )
    }
    return (
        <div>
            {showthislist()}

        </div>
    )

}


export default ShowList;
